import { createServer } from "miragejs/server";

let users = [
    {id: 1, email: "labas@a", pass: "abc"},
]

createServer({
    routes() {
        this.namespace = "api"

        this.get("/users", (schema, request) => {
            let attrs = JSON.parse(request.requestBody)
            return {
                attrs
            }
        })
    },
})
